import './header.css';

const Header = (props) => {

    const onHome = () => {
        props.homeHandler();
    }


    return(
        <div>
            <header className="header">
                <div className="conteiner">
                    <nav className="menu__row">
                        <a className="menu__logo"></a>
                        <div className="menu__options">
                            <a className="option" onClick={onHome}> Home </a>
                            <a className="option"> Cars </a>
                            <a className="option"> Log in </a>
                            <a className="option"> Log out </a> 
                        </div>  
                    </nav>
                </div>
            </header>  
        </div>
    )
}

export default Header;
